	min-height: 100vh;
	width: 80vw;
	margin: 0 auto;

	display: flex;
	justify-content: center;
	align-items: center;

	position: relative;
`;

const Container = styled.div`
	min-height: 100vh;
	display: flex;
	flex-direction: column;
	justify-content: center;
	align-items: center;
`;

const Banner = () => {
	return (
		<Section>
			<Container>
				<BannerComponent>
					<span>
						Fashion is the armour to survive the reality of everyday life.
					</span>
				</BannerComponent>
				<BannerComponent>
					<span> to survive the reality of everyday life.</span>
				</BannerComponent>
			</Container>
		</Section>
	);
};

export default Banner;
